import data from "./Data2";
import "./Content.css";
const Content = () => {
  const properties = data.properties[0];
  console.log(properties.index);

  return (
    <div className="wrapper1">
      <div className="wrapper2">
        {properties.map((index) => {
          <div className="wrapper3"></div>;
        })}
      </div>
    </div>
  );
};
export default Content;
